import React from 'react';
  
const JaV = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
    >
      <h1>GeeksforGeeks is a Computer  for geeks.</h1>
    </div>
  );
};
  
export default Jav;
